import React, { Component } from "react";

class  TableUser extends Component {
    render()
    {
        return(<div><h1>Hii</h1></div>)

    }
}

const MyrepList = function (props) {
    return (
        <div>
            <div className="container" onClick={props.showPopupMyRep} style={{ padding: "0 5%", margin: "0 10%" }}>
                <div className="content">
                    <div className="firsthalfcontent">
                        <h4>{props.heading}</h4>
                        <p>{props.timedate}</p>
                        <p id="stts">{props.status}</p>
                    </div>
                    <div className="secondhalfcontent">
                        <p>Comment</p>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default TableUser
